import gql from 'graphql-tag';

export const ADD_PLANT = gql`
mutation AddPlant($id: ID!, $name: String!, $controllerId: Int!) {
  addPlant(
    id: $id,
    name: $name,
    controllerId: $controllerId
  ) {
    message
    status
  }
}
`;

export const UPDATE_PLANT = gql`
mutation UpdatePlant($id: ID!, $name: String!, $humedad: Int, $temperatura: Int, $mapeoTierra: Int, $mapeoLuz: Int) {
  updatePlant(
    controllerId: $id,
    name: $name,
    humedad: $humedad,
    temperatura: $temperatura,
    mapeoTierra: $mapeoTierra,
    mapeoLuz: $mapeoLuz
  ) {
    id
  }
}
`;

export const GET_PLANTS = gql`
mutation GetUserPlants($id: ID!, $name: String!, $humedad: Int, $temperatura: Int, $mapeoTierra: Int, $mapeoLuz: Int) {
  getUserPlants(
    id: $id,
  ) {
    id
  }
}
`;
